    from modeller import forms, physical, features
    for (res, values) in phipsi:
        arr = True
        for a in atmsel.find_atoms(res, ('-C', 'N', 'CA', 'C',
                                         'N', 'CA', 'C', '+N'), num_selected):
            r = forms.NDSpline(physical.phi_psi_dihedral, values,
                               dimensions=(72,72), use_array=arr)
            r.add_dimension(features.Dihedral(*a[:4]), open=False,
                            low=-3.09796, high=3.18523, delta=0.08727,
                            lowderiv=0., highderiv=0.)
            r.add_dimension(features.Dihedral(*a[4:]), open=False,
                            low=-3.09796, high=3.18523, delta=0.08727,
                            lowderiv=0., highderiv=0.)
            arr = restraints.add(r)
